function renderPage() {
  // #region Header
  var scrollTop = document.documentElement.scrollTop;
  var headerTop = 74 - scrollTop;
  var percent = Math.round(scrollTop * 74 / 100);
  var header = document.querySelector('header');
  if (percent > 70) {
    percent = 70;
    // Переключаемся на тёмный текст
    header.classList.add('dark');
    $('#logo-text').attr('src', '/lpk-2024/img/logo_text.svg');
    $('#logo-leaf').attr('src', '/lpk-2024/img/logo_leaf.svg');
  } else {
    header.classList.remove('dark');
    $('#logo-text').attr('src', '/lpk-2024/img/logo_text_white.svg');
    $('#logo-leaf').attr('src', '/lpk-2024/img/logo_leaf_white.svg');
  }
  if (headerTop < 0 || window.innerWidth <= 900) headerTop = 0;
  var top = "".concat(headerTop, "px");
  header.style.backgroundColor = "rgba(255, 255, 255, ".concat(percent / 100, ")");
  header.style.top = top;

  // #endregion

  // #region Timer
  var currentDate = new Date(); // Текущая дата
  var timerEl = document.querySelector('.timer');
  var endDateStr = timerEl.dataset['end'];
  var endDate = new Date(endDateStr); // Целевая дата

  // Расчитываем разницу между текущей и целевой датой
  var timeDiff = endDate.getTime() - currentDate.getTime();
  if (timeDiff <= 0) {
    // Скрываем счётчик, и отображаем уведомление о том, что приём начался
    $('#hero').hide();
    $('#new-hero').removeClass("hide").show();
  }

  // Вычисляем количество дней, часов, минут и секунд до достижения цели
  var days = Math.floor(timeDiff / (1000 * 3600 * 24));
  var hours = Math.floor(timeDiff % (1000 * 3600 * 24) / (1000 * 3600));
  var minutes = Math.floor(timeDiff % (1000 * 3600) / 60000);
  var seconds = Math.floor(timeDiff % 60000 / 1000);
  var daysEl = document.querySelector('#d');
  var hoursEl = document.querySelector('#h');
  var minutesEl = document.querySelector('#m');
  var secondsEl = document.querySelector('#s');
  daysEl.textContent = addZero(days);
  hoursEl.textContent = addZero(hours);
  minutesEl.textContent = addZero(minutes);
  secondsEl.textContent = addZero(seconds);
  // #endregion

  requestAnimationFrame(renderPage);
}

